                    return (Enchantment_FieldIndex)((int)index);
                case MajorRecord_FieldIndex.Version:
                    return (Enchantment_FieldIndex)((int)index);
                case MajorRecord_FieldIndex.EditorID:
                    return (Enchantment_FieldIndex)((int)index);
                case MajorRecord_FieldIndex.RecordType:
